import Personal from './components/Personal';
import Workexp from './components/Workexp';
import Education from './components/Education';
import Skills from './components/Skills';


const App = () => {
    return (
    <div className="App">
      <Personal ></Personal>
      <Workexp ></Workexp>
      <Education></Education>
      <Skills></Skills>
    </div>
  )

}



export default App;
